sys_variable_value.value:
(function execute(inputs, outputs) {

    var finalJSON = {};
    var tempJSON = inputs.query;
    for (var i = 0; i < tempJSON.length; i++) {
        for (var key in tempJSON[i]) {
            finalJSON[key.trim()] = tempJSON[i][key].toString().trim();
        }
    }
    var jsonObject = JSON.stringify(finalJSON);
    jsonObject = "IT_OPTIONS=[" + jsonObject.toString() + "]";
    outputs.return_string = jsonObject;

})(inputs, outputs);

